import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import Rank from './components/Rank/Rank';
import FaceDetection from './components/FaceDetection/FaceDetection';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import './App.css';

const app = new Clarifai.App({
 apiKey: '4662bcd0f72f40c88203cc4561e1e39c'
});

const paramtersObject = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}


class App extends Component {
  constructor() {
    super();
    this.state = {
      input : ''
    }
  }

  onInputChange = (event) => {
    this.setState({
      input : event.target.value
    });
  }

  onButtonClick = () => {
    app.models.predict(Clarifai.FACE_DETECT_MODEL , "https://www.bureaucollective.ch/img/projects/32/elements/82/Bureau-Collective-Diversity-of-the-Human-Face-04.jpg").then(
    function(response) {
      console.log(response);
    },
    function(err) {
      console.log("There was an error fetching the image");
    }
  );
  }

  render() {
    return (
      <div>
        <Particles className="particles" params={paramtersObject} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonClick={this.onButtonClick}/> 
        <FaceDetection />
      </div>
    );
  }
}

export default App;
